import React, { Component } from 'react';
import logo from '../reactlogo.png';

const jumbotronStyle = {
  paddingBottom: '150px',
  boxShadow: '0px 0px 0px 0px rgba(0,0,0,0)',
  marginTop: 0,
  height: '100vh',
  backgroundColor: '#0E3746'
};

const logoStyle = {
  marginLeft: '70vh'
};

class Home extends Component {
  render() {
    return (
      <div>
        <div className="card-panel lighten-2" style={jumbotronStyle}>
          <div
            className="container"
            style={{ color: '#ffffff', marginTop: '20vh' }}
          >
            <div className="row">
              <div className="col s12 m6 14">
                <img src={logo} style={logoStyle} className="responsive-img" />
              </div>
            </div>
            <h1>{this.props.heading}</h1>
            <h5>This is what I built to revise React!</h5>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
